import React from 'react';
import '../../App.css';

export default function Shaan() {
  return (
    <div>
      <h1>The Broken Gener Barrier</h1>
      <p>
      The prohibition era was an era of radical reform for women. Before the 1920s women were forced to carry on stereotypical gender roles that prevented 
      them from having much freedom. After the suffrage  movement was passed in 1920, women became optimistic and venturous with their new found freedom. Women started to dramatically shift the notion on how women should behave. Women started to become heavily involved in politics by forming various parties including the National Woman's Party(NWP). The 1920s was also a time of  promiscuity, which lead to the first documented sex revolution of american history. Women no longer felt the need to be "lady like", instead women would go to bars, drink with the men, dress provocatively, and sometimes dance on tables.

      </p>
    </div>
  )

}
